import React from 'react';
import { browserHistory, Link } from 'react-router';

import { Table, Divider, Tag,Form,Select } from 'antd';



const FormItem = Form.Item;
const { Option } = Select;
const formItemLayout = {
  labelCol: { span: 8 },
  wrapperCol: { span: 12 },
};

class ShopList extends React.Component {
    constructor(props) {
        super(props);
        this.state = { 
            msg:'我是商品列表'
         };
    }
    render() {
        const columns = [
            {
              title: 'Name',
              dataIndex: 'name',
              key: 'name',
              render: text => <a>{text}</a>,
            },
            {
              title: 'Age',
              dataIndex: 'age',
              key: 'age',
            },
            {
              title: 'Address',
              dataIndex: 'address',
              key: 'address',
            },
            {
              title: 'Tags',
              key: 'tags',
              dataIndex: 'tags',
              render: tags => (
                <span>
                  {tags.map(tag => {
                    let color = tag.length > 5 ? 'geekblue' : 'green';
                    if (tag === 'loser') {
                      color = 'volcano';
                    }
                    return (
                      <Tag color={color} key={tag}>
                        {tag.toUpperCase()}
                      </Tag>
                    );
                  })}
                </span>
              ),
            },
            {
              title: 'Action',
              key: 'action',
              render: (text, record) => (
                <span>
                  <a>Invite {record.name}</a>
                  <Divider type="vertical" />
                  <a>Delete</a>
                </span>
              ),
            },
          ];

          const data = [
            {
              key: '1',
              name: 'John Brown',
              age: 32,
              address: 'New York No. 1 Lake Park',
              tags: ['nice', 'developer'],
            },
            {
              key: '2',
              name: 'Jim Green',
              age: 42,
              address: 'London No. 1 Lake Park',
              tags: ['loser'],
            },
            {
              key: '3',
              name: 'Joe Black',
              age: 32,
              address: 'Sidney No. 1 Lake Park',
              tags: ['cool', 'teacher'],
            },
          ];
        return (
            <div className='info'> 
             <Form className="cc-table-filter" key="form" layout="inline">
          <FormItem {...formItemLayout} label="Mock名称：">
            {getFieldDecorator('mockName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入名称" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="接口API：">
            {getFieldDecorator('interfaceName', {
              initialValue: '',
              rules: [],
            })(<Input className="input-md" maxLength="100" placeholder="请输入接口" />)}
          </FormItem>
          <FormItem {...formItemLayout} label="状态：">
            {getFieldDecorator('status', {
              initialValue: '',
              rules: [],
            })(<Select placeholder="" style={{ width: 140 }}>
              <Option value="0">未启用</Option>
              <Option value="1">运行中</Option>
              <Option value="2">已停止</Option>
            </Select>)}
          </FormItem>

          <FormItem>
            <Button
              type="primary"
              htmlType="submit"
              onClick={() => this.onSearch(1)}
            >
查询
            </Button>
          </FormItem>
          <FormItem>
            <Button
              htmlType="submit"
              onClick={this.onReset}
            >
重置
            </Button>
          </FormItem>
        </Form>
        <Table columns={columns} dataSource={data} />

            </div>
        );
    }
}

export default ShopList;
